import './App.css';
import TopNav from './TopNav.js';
import HomePage from './HomePage.js';
import BrandSearchPage from './BrandSearchPage.js';
import WriteUpPage from './WriteUpPage.js';
import React from 'react';
import {
  HashRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const TITLE = 'Root'
class App extends React.Component{
  constructor(props){
    super(props);

  }

  componentDidMount() {
    document.title = TITLE;

    fetch("https://api.root.quest/brandsearch?name=" + brandTitle)
    .then(res => res.json())
    .then(
      (result) => {
        this.setState({
          isLoaded: true,
          brand: result
        });
      },
      // Note: it's important to handle errors here
      // instead of a catch() block so that we don't swallow
      // exceptions from actual bugs in components.
      (error) => {
        this.setState({
          isLoaded: true,
          error
        });
      }
    )
  }

  render() {
  return (
    <div style = {{backgroundColor: "#F5EFE2", height: "100vh", width: "100wh"}}>
      <Router>
        <div class = "top-nav">
          <div class = "nav-bar">
              <Link to="/"><p style = {{fontSize: '30px'}}><a>Home</a></p></Link>
              <Link to="/search"><p style = {{fontSize: '30px'}}><a>Brand Search Index</a></p></Link>
          </div>
          <h1 style = {{fontSize: '48px', paddingLeft: 10, paddingRight: 10}}>Root</h1>
        </div>
      <Switch>
        <Route path="/search">
            <BrandSearchPage />
        </Route>

        <Route path="/writeup/nike">
            <WriteUpPage brandTitle="Nike"/>
        </Route>
        <Route path="/writeup/patagonia">
            <WriteUpPage brandTitle="Patagonia"/>
        </Route>
        <Route path="/writeup/nike">
            <WriteUpPage brandTitle="Nike"/>
        </Route>

        <Route path="/">
            <HomePage />
        </Route>

      </Switch>
    </Router>

    </div>

  );
  }
}

export default App;
